DoublyLinkedList.prototype.append = function (data) {
  var newNode = new Node(data);
  // \u82E5\u662F\u7B2C\u4E00\u6B21\u6DFB\u52A0\uFF0C\u76F4\u63A5\u5C06head\u548Ctail\u6307\u5411\u65B0\u8282\u70B9\u5373\u53EF
  if (this.length === 0) {
    this.head = newNode;
    this.tail = newNode;
  } else {
    // \u8BA9tail\u4E0E\u65B0\u8282\u70B9\u7684prev\u5EFA\u7ACB\u8FDE\u63A5
    newNode.prev = this.tail;
    // tail\u7684next\u6307\u5411\u65B0\u8282\u70B9
    this.tail.next = newNode;
    // \u6539\u53D8tail\u6307\u9488
    this.tail = newNode;
  }

  this.length += 1;
};
