linked.update(0, '000');
console.log(linked.get(0)); // 000

console.log(linked.removeAt(0)); // 000
console.log(linked.removeAt(4)); // 55
console.log(linked.toString()); // 10 22 20 30

console.log(linked.remove('10')); // 10
console.log(linked.toString()); // 22 20 30
