`,paraId:0},{value:"\u5F53\u7B2C i \u4E2A\u623F\u5B50\u7C89\u5237\u989C\u8272 j \u65F6\uFF0C\u7C89\u5237 [0..i] \u8FD9\u4E9B\u623F\u5B50\u6240\u9700\u7684\u6700\u5C11\u82B1\u8D39\u4E3A dp[i][j]\u3002",paraId:0},{value:"\u6709\u4E86\u8FD9\u4E2A\u5B9A\u4E49\uFF0C\u9898\u76EE\u60F3\u6C42\u7684\u7B54\u6848\u5C31\u662F ",paraId:0},{value:"sum(dp[n-1][..])",paraId:0},{value:"\u3002",paraId:0},{value:"\u53C8\u56E0\u4E3A\u9898\u76EE\u8BF4\u76F8\u540C\u7684\u989C\u8272\u4E0D\u80FD\u76F8\u90BB\uFF0C\u6240\u4EE5\u72B6\u6001\u8F6C\u79FB\u65B9\u7A0B\u4E3A\uFF1A",paraId:0},{value:`// \u989C\u8272 0 \u53EA\u80FD\u6328\u7740\u989C\u8272 1 \u6216\u989C\u8272 2
dp[i][0] = min(dp[i - 1][1], dp[i - 1][2]) + costs[i][0];
// \u989C\u8272 1 \u53EA\u80FD\u6328\u7740\u989C\u8272 0 \u6216\u989C\u8272 2
dp[i][1] = min(dp[i - 1][0], dp[i - 1][2]) + costs[i][1];
// \u989C\u8272 2 \u53EA\u80FD\u6328\u7740\u989C\u8272 0 \u6216\u989C\u8272 1
dp[i][2] = min(dp[i - 1][0], dp[i - 1][1]) + costs[i][2];
`,paraId:0},{value:`/**
 * @param {number[][]} costs
 * @return {number}
 */
var minCost = function (costs) {
  const n = costs.length;
  // \u5B9A\u4E49dp\u6570\u7EC4
  // dp[i][j]\u8868\u793A[0...i]\u53F7\u623F\u5B50\uFF0C\u7C89\u62100\uFF0C1\uFF0C2\u53F7\u989C\u8272\u6240\u9700\u6700\u5C11\u6210\u672C
  const dp = new Array(n).fill(0).map((_) => [0, 1, 2]);
  // base case
  // \u7B2C0\u6392\u82B1\u8D39\u7684\u6700\u5C11\u6210\u672C\u5C31\u662Fcosts[0][j]
  dp[0] = costs[0];

  for (let i = 1; i < n; i++) {
    // dp[i]\u7684\u6700\u5C0F\u6210\u672C = dp[i-1]\u7684\u6700\u5C0F\u6210\u672C+\u5F53\u524D\u5C42\u7684\u6210\u672C
    // \u56E0\u4E3A\u76F8\u90BB\u989C\u8272\u4E0D\u80FD\u76F8\u540C,\u6240\u4EE50\u989C\u8272\uFF0C\u53EA\u80FD\u90091\uFF0C2\u989C\u8272\u7684\u6700\u5C0F\u6210\u672C + \u5F53\u524D\u989C\u8272\u6210\u672C
    dp[i][0] = Math.min(dp[i - 1][1], dp[i - 1][2]) + costs[i][0];
    dp[i][1] = Math.min(dp[i - 1][0], dp[i - 1][2]) + costs[i][1];
    dp[i][2] = Math.min(dp[i - 1][0], dp[i - 1][1]) + costs[i][2];
  }

  // \u627E\u51FA[0...i]\u53F7\u623F\u5B50\u4E2D\u82B1\u8D39\u6700\u5C11\u7684\u6210\u672C
  const res = Math.min.call(null, ...dp[n - 1]);
  return res;
};

`,paraId:0},{value:"\u5251\u6307 Offer II 097. \u5B50\u5E8F\u5217\u7684\u6570\u76EE",paraId:0},{value:"hard",paraId:0},{value:"\u8DDF",paraId:67,tocIndex:59},{value:"115\u9898",paraId:67,tocIndex:59},{value:"\u76F8\u540C",paraId:67,tocIndex:59},{value:`/**
 * @param {string} s
 * @param {string} t
 * @return {number}
 */
var numDistinct = function (s, t) {
  // \u4EE5s\u89C6\u89D2\u51FA\u53D1\uFF0C\u5BFB\u627E\u5B50\u5E8F\u5217\u7684\u4E2A\u6570
  const m = s.length,
    n = t.length;
  const memo = new Array(m + 1).fill(-1).map((_) => new Array(n + 1).fill(-1));

  // \u5B9A\u4E49dp(i,j)
  // \u8FD4\u56DE[i,...]\u4E2D \u5B50\u5E8F\u5217t[j,...]\u7684\u6570\u91CF
  const dp = (i, j) => {
    // base case
    if (j === n) return 1; // \u5C31\u8D70\u5230\u5934\uFF0C\u5339\u914D\u4E00\u4E2A\u5B50\u5E8F\u5217
    if (n - j > m - i) return 0; // t\u7684\u5269\u4F59\u957F\u5EA6\u5927\u4E8Es\uFF0C\u8BF4\u660E\u4E0D\u5339\u914D\uFF0C\u76F4\u63A5\u8FD4\u56DE0
    if (memo[i][j] !== -1) return memo[i][j];

    let res = 0;
    if (s[i] === t[j]) {
      // aab,ab => a_b , _ab
      res += dp(i + 1, j + 1) + dp(i + 1, j);
    } else {
      // \u5982\u679Cs[i]!==t[j],i\u7EE7\u7EED\u5F80\u540E\u8D70\uFF0C\u8DDFt[j]\u8FDB\u884C\u5C1D\u8BD5\u5339\u914D
      res += dp(i + 1, j);
    }
    memo[i][j] = res;
    return res;
  };

  return dp(0, 0);
};
`,paraId:0},{value:"\u5251\u6307 Offer II 098. \u8DEF\u5F84\u7684\u6570\u76EE",paraId:0},{value:"medium",paraId:0},{value:"\u8DDF",paraId:68,tocIndex:60},{value:"62\u9898",paraId:68,tocIndex:60},{value:"\u76F8\u540C",paraId:68,tocIndex:60},{value:`/**
 * @param {number} m
 * @param {number} n
 * @return {number}
 */
var uniquePaths = function (m, n) {
  const memo = new Array(m + 1).fill(-1).map((_) => new Array(n).fill(-1));

  // \u5B9A\u4E49dp(i,j)
  // \u8FD4\u56DE0,0\u8D70\u5230i,j\u7684\u8DEF\u5F84\u6570\u91CF
  const dp = (i, j) => {
    // base case
    if (i === 0 && j === 0) return 1;
    if (i < 0 || j < 0) return 0;
    if (memo[i][j] !== -1) return memo[i][j];

    // i,j\u70B9\u7684\u6570\u91CF\u548C = \u5230\u8FBE\u5DE6\u8FB9\u7684\u6570\u91CF + \u5230\u8FBE\u4E0A\u9762\u7684\u6570\u91CF
    // dp(i,j)= dp(i-1,j) \u7684\u6570\u91CF+dp(i,j-1)\u7684\u6570\u91CF
    memo[i][j] = dp(i - 1, j) + dp(i, j - 1);

    return memo[i][j];
  };

  return dp(m - 1, n - 1);
};

`,paraId:0},{value:"\u5251\u6307 Offer II 103. \u6700\u5C11\u7684\u786C\u5E01\u6570\u76EE",paraId:0},{value:"medium",paraId:0},{value:"\u8DDF",paraId:69,tocIndex:61},{value:"322\u9898",paraId:69,tocIndex:61},{value:"\u76F8\u540C",paraId:69,tocIndex:61},{value:`/**
 * @param {number[]} coins
 * @param {number} amount
 * @return {number}
 */
var coinChange = function (coins, amount) {
  const memo = [];
  // \u5B9A\u4E49dp(n)\u53EF\u4EE5\u8FD4\u56DEamount\u4E3An\u65F6\uFF0C\u6240\u9700\u8981\u7684\u6700\u5C11\u786C\u5E01\u6570\u91CF
  function dp(n) {
    if (n === 0) return 0;
    if (n < 0) return -1;
    if (memo[n] !== undefined) return memo[n];
    let res = Infinity;
    for (const coin of coins) {
      const subProblem = dp(n - coin);
      if (subProblem === -1) continue;
      res = Math.min(res, 1 + subProblem);
    }
    memo[n] = res === Infinity ? -1 : res;
    return memo[n];
  }

  return dp(amount);
};

