var copyRandomList = function (head, map = new Map()) {
  if (head === null) return null;
  if (!map.has(head)) {
    map.set(head, {
      val: head.val,
      // next: copyRandomList(head.next, map),
      // random: copyRandomList(head.random, map)
    });
    Object.assign(map.get(head), {
      next: copyRandomList(head.next, map),
      random: copyRandomList(head.random, map),
    });
  }

  return map.get(head);
};
