var findNumberIn2DArray = function (matrix, target) {
  if (matrix.length === 0) return false;
  const m = matrix.length,
    n = matrix[0].length;

  // \u521D\u59CB\u5316i,j\u4E3A\u53F3\u4E0A\u89D2\u5143\u7D20
  let i = 0,
    j = n - 1;
  while (i < m && j >= 0) {
    if (matrix[i][j] === target) {
      return true;
    } else if (matrix[i][j] > target) {
      // \u9700\u8981\u5C0F\u4E00\u70B9\uFF0Cj--
      j--;
    } else if (matrix[i][j] < target) {
      // \u9700\u8981\u5927\u4E00\u70B9\uFF0Ci++
      i++;
    }
  }
  // \u5FAA\u73AF\u7ED3\u675F\u6CA1\u627E\u5230\uFF0C\u8FD4\u56DEfalse
  return false;
};
