// \u5B9A\u4E49\u51FD\u6570\uFF1A\u8FD4\u56DE\u5F53\u524D\u8282\u70B9\u7FFB\u8F6C\u8FC7\u540E\u7684\u8282\u70B9
var mirrorTree = function (root) {
  if (root === null) return null;

  let leftRoot = mirrorTree(root.left);
  let rightRoot = mirrorTree(root.right);
  root.left = rightRoot;
  root.right = leftRoot;
  return root;
};
