\u7A7A\u95F4\u590D\u6742\u5EA6O(N)`,paraId:26,tocIndex:34},{value:"\u521B\u5EFA\u4E00\u4E2A\u65B0\u7684\u94FE\u8868\uFF0C\u5176\u4E2D\u300C\u4E0D\u5305\u542Bval\u300D\u76F8\u5F53\u4E8E\u628Aval\u5220\u9664\uFF0C\u8FD4\u56DE\u65B0\u7684\u94FE\u8868",paraId:0},{value:`/**
 * @param {ListNode} head
 * @param {number} val
 * @return {ListNode}
 */
var deleteNode = function (head, val) {
  let newList = new ListNode(-1);
  let q = newList; // q\u8D1F\u8D23\u7ED3\u679C\u94FE\u8868
  let p = head; // p \u8D1F\u8D23\u904D\u5386\u539F\u94FE\u8868
  while (p) {
    if (p.val !== val) {
      q.next = new ListNode(p.val); // \u521B\u5EFA\u65B0\u7684\u8282\u70B9
      q = q.next;
    }

    p = p.next;
  }
  return newList.next;
};
