var exchange = function (nums) {
  let fast = 0, slow = 0;
  // \u7EF4\u62A4[0,slow)\u90FD\u662F\u5947\u6570
  while (fast < nums.length) {
    if (nums[fast] % 2 === 1) {
      const temp = nums[slow];
      nums[slow] = nums[fast];
      nums[fast] = temp;
      slow++;
    }
    fast++;
  }
  return nums;
};

