\u7A7A\u95F4\u590D\u6742\u5EA6O(n)`,paraId:31,tocIndex:37},{value:"\u601D\u8DEF",paraId:0},{value:"\u58F0\u660E\u4E24\u4E2A\u6570\u7EC4\uFF0C\u4E00\u4E2A\u653E\u5947\u6570\uFF0C\u53E6\u4E00\u4E2A\u653E\u5076\u6570",paraId:0},{value:"\u7136\u540E\u5FAA\u73AF\u5224\u65ADnum\u7684\u5947\u5076\uFF0C\u653E\u5165\u5BF9\u5E94\u7684\u6570\u7EC4",paraId:0},{value:"\u6700\u540E\u5C06\u5947\u6570\u548C\u5076\u6570\u8FDB\u884C\u524D\u540E\u62FC\u63A5\u8FD4\u56DE",paraId:0},{value:`/**
 * @param {number[]} nums
 * @return {number[]}
 */
var exchange = function (nums) {
  const firstArr = [];
  const lastArr = [];
  for (let num of nums) {
    num % 2 === 0 ? lastArr.push(num) : firstArr.push(num);
  }
  return firstArr.concat(lastArr);
};
