\u7A7A\u95F4\u590D\u6742\u5EA6O(1)`,paraId:32,tocIndex:38},{value:"\u601D\u8DEF",paraId:0},{value:"\u56E0\u4E3A\u6570\u7EC4\u662F\u6709\u5E8F\u7684\uFF0C\u6240\u4EE5\u53EF\u4EE5\u5229\u7528 sum\u7684\u5927\u5C0F\u5173\u7CFB\uFF0C\u53BB\u9760\u8FD1target\uFF0C\u7C7B\u4F3C\u4E8E\u4E8C\u5206\u67E5\u627E\u7684\u601D\u8DEF",paraId:0},{value:"\u4E0D\u8FC7\u8FD9\u91CC\u662F\u4F7F\u7528\u5934\u5C3E\u53CC\u6307\u9488",paraId:0},{value:"\u5982\u679Csum\u592A\u5927\u4E86\uFF0C\u5C31right--",paraId:0},{value:"\u5982\u679Csum\u5C0F\u4E86\uFF0C\u5C31left++",paraId:0},{value:"sun===target\u65F6\uFF0C\u8FD4\u56DEleft\u548Cright\u4F4D\u7F6E\u4E0A\u7684\u503C\u5373\u53EF",paraId:0},{value:`/**
 * @param {number[]} nums
 * @param {number} target
 * @return {number[]}
 */
// \u53CC\u6307\u9488
var twoSum = function (nums, target) {
    let left = 0, right = nums.length - 1;

    while (left < right) {
        const sum = nums[left] + nums[right];
        if (sum === target) {
            return [nums[left], nums[right]];
        } else if (sum > target) {
            right--;
        } else if (sum < target) {
            left++;
        }
    }
};
