`,paraId:0},{value:"\u5251\u6307 Offer 12. \u77E9\u9635\u4E2D\u7684\u8DEF\u5F84",paraId:0},{value:"medium",paraId:0},{value:"\u56DE\u6EAF",paraId:34,tocIndex:40},{value:`
\u8DDF`,paraId:34,tocIndex:40},{value:"79.\u5355\u8BCD\u641C\u7D22",paraId:34,tocIndex:40},{value:"\u76F8\u540C",paraId:34,tocIndex:40},{value:`/**
 * @param {character[][]} board
 * @param {string} word
 * @return {boolean}
 */
// \u56DE\u6EAF
var exist = function (board, word) {
  const m = board.length,
    n = board[0].length;
  // false\u8868\u793A\u672A\u8BBF\u95EE\uFF0Ctrue\u8868\u793A\u8BBF\u95EE\u8FC7
  const visited = new Array(m).fill().map((_) => new Array(n).fill(false));
  const len = word.length;

  // \u5B9A\u4E49\u51FD\u6570
  // \u8FD4\u56DE [i,j]\u4E3A\u8D77\u70B9\u80FD\u591F\u627E\u51FA word[p..end]
  const canFind = (i, j, p) => {
    if (p === len) {
      // p\u6307\u9488\u8D8A\u754C\u4E86\uFF0C\u8FD4\u56DEtrue
      return true;
    }

    // \u8D8A\u754C\u76F4\u63A5\u8FD4\u56DEfalse
    if (i < 0 || i >= m || j < 0 || j >= n) return false;
    // \u8BBF\u95EE\u8FC7 \u6216\u8005\u4E0D\u662F\u8981\u5BFB\u627E\u7684\u76EE\u6807 \u4E5F\u8FD4\u56DEfalse
    if (visited[i][j] || board[i][j] !== word[p]) return false;

    // \u5269\u4E0B\u7684\u60C5\u51B5\u5C31\u662F board[i][j] === word[p]

    visited[i][j] = true; // \u8BBF\u95EE
    // \u8BBF\u95EE\u4E0A\u4E0B\u5DE6\u53F3
    const canFindRes =
      canFind(i, j + 1, p + 1) ||
      canFind(i, j - 1, p + 1) ||
      canFind(i + 1, j, p + 1) ||
      canFind(i - 1, j, p + 1);

    if (canFindRes) return true; // \u5982\u679C\u80FD\u627E\u5230 \u8FD4\u56DEtrue

    visited[i][j] = false; // \u64A4\u9500\u8BBF\u95EE
    return false;
  };

  for (let i = 0; i < m; i++) {
    for (let j = 0; j < n; j++) {
      if (board[i][j] === word[0] && canFind(i, j, 0)) {
        return true;
      }
    }
  }
  return false;
};
