\u7A7A\u95F4\u590D\u6742\u5EA6O(1)`,paraId:37,tocIndex:44},{value:"\u601D\u8DEF",paraId:0},{value:"\u8DDF",paraId:0},{value:"230.\u4E8C\u53C9\u641C\u7D22\u6811\u4E2D\u7B2CK\u5C0F\u7684\u5143\u7D20",paraId:0},{value:"\u7C7B\u4F3C",paraId:0},{value:"\u4E0D\u8FC7230\u662F\u5229\u7528\u4E2D\u5E8F\u904D\u5386\u6709\u5E8F\u7684\u7279\u70B9\uFF0C\u6C42\u7B2Ck\u5C0F\uFF0C\u8FD9\u91CC\u6C42\u7B2Ck\u5927",paraId:0},{value:"\u53EF\u4EE5\u5728\u4E2D\u5E8F\u4F4D\u7F6E\u6539\u53D8\u4E2D\u5E8F\u7684\u7ED3\u679C\u4E3A\u5012\u5E8F",paraId:0},{value:"\u5148\u904D\u5386right\uFF0C\u518D\u904D\u5386left\u5C31\u53EF\u4EE5\u4E86",paraId:0},{value:"\u7136\u540E\u4F7F\u7528rank\u8BB0\u5F55\u5F53\u524D\u6392\u540D\uFF0C\u5F53rank\u5230k\u65F6\uFF0C\u8FD4\u56DEres\u5373\u53EF",paraId:0},{value:`/**
 * @param {TreeNode} root
 * @param {number} k
 * @return {number}
 */
var kthLargest = function (root, k) {
    let res = 0;// \u8BB0\u5F55\u7ED3\u679C
    let rank = 0; // \u8BB0\u5F55\u6392\u540D

    const traverse = (root) => {
        if (root === null) return;
        // \u5148\u904D\u5386right\uFF0C\u4F7F\u4E2D\u5E8F\u7ED3\u679C\u5012\u5E8F
        traverse(root.right);
        rank++;
        if (rank === k) {
            res = root.val;
            return;
        }
        traverse(root.left);
    }
    traverse(root);

    return res;
};
