var isValidSerialization = function (preorder) {
  let edge = 1; // \u4E00\u6761\u6307\u5411\u6839\u8282\u70B9\u7684\u865A\u62DF\u8FB9
  for (const i of preorder.split(",")) {
    if (i === "#") {
      edge--; // \u7A7A\u8282\u70B9\u6D88\u8017\u4E00\u6761\u8FB9
      if (edge < 0) return false;
    } else {
      edge--; // \u8282\u70B9\u6D88\u8017\u4E00\u6761\u8FB9
      if (edge < 0) return false;
      edge += 2; // \u751F\u6210\u4E24\u6761\u8FB9
    }
  }
  return edge === 0; // \u6700\u540E\u4E0D\u5E94\u8BE5\u6709\u7A7A\u95F2\u8FB9
};
